import React from "react";

export default function Navbar() {
  return (
    <div>
      <div className="nav">
        <ul>
          <a href="/Home">
            <li>Home</li>
          </a>
          <a href="/about"><li>About</li></a>
         <a href="/projects"> <li>Projects</li></a>
        
          <li>Contact</li>
        </ul>
      </div>
      <div className="part2"></div>
    </div>
  );
}
